/**
 * @param {number[]} arr
 * @return {number}
 */
var minJumps = function (arr) {
    let n = arr.length;
    let dp = new Array(n).fill(Infinity);
    dp[0] = 0;

    let map = new Map();
    arr.forEach((v, i) => {
        map.set(v, (map.get(v) || []).concat(i));
    })

    let lineArr = new Array();
    let lineArrMap = new Array(arr.length).fill(false);
    lineArr.push({ i: 0, element: arr[0] });
    lineArrMap[0] = true;
    debugger
    while (lineArr.length > 0) {
        let nextSteps = new Array();
        for (let index = lineArr.length - 1; index >= 0; index++) {
            let { i, element } = lineArr[index];
            debugger
            if (i - 1 >= 0) {
                dp[i] = Math.min(dp[i], dp[i - 1] + 1);
                if (!lineArrMap[i - 1]) {
                    nextSteps.push({ i: i - 1, element: arr[i - 1] })
                }
            }
            if (i + 1 < n) {
                dp[i] = Math.min(dp[i], dp[i + 1] + 1);
                if (!lineArrMap[i + 1]) {
                    nextSteps.push({ i: i + 1, element: arr[i + 1] })
                }
            }
            let nextArr = map.get(element).filter((v) => (v !== i));
            debugger
            let dpArr = nextArr.map(v => {
                if (!lineArrMap[v]) {
                    nextSteps.push({ i: v, element: arr[v] })
                }
                return dp[v] + 1;
            });
            dp[i] = Math.min(...dpArr, dp[i]);
            lineArrMap[i] = true;
            if (i === n - 1) {
                return dp[i];
            }
        }
        nextSteps = removeDuplicateObjects(nextSteps, "i");
        lineArr = [...nextSteps];
    }

    return dp[n - 1];
};
function removeDuplicateObjects(arr, key) {
    const uniqueObjects = [];
    const seenKeys = new Set();

    for (const obj of arr) {
        const keyValue = obj[key];

        if (!seenKeys.has(keyValue)) {
            seenKeys.add(keyValue);
            uniqueObjects.push(obj);
        }
    }

    return uniqueObjects;
}

